INSERT INTO `comentario` VALUES (1,'positivo','Una lectura maravillosa que me mantuvo enganchado desde la primera página.',1,1),(2,'positivo','Me encanta la evolución de la trama en este libro. Muy bien escrito.',2,2),(3,'neutral','Un buen libro, pero no tan emocionante como el anterior.',3,3),(4,'positivo','Un libro emocionante y lleno de sorpresas. Gran continuación de la saga.',4,4),(5,'negativo','Demasiado predecible y con personajes planos. No cumplió mis expectativas.',5,5),(6,'negativo','El ritmo es muy lento y la trama se siente forzada. No lo recomendaría.',6,6),(7,'negativo','La historia se vuelve repetitiva y poco original. Esperaba más.',7,7),(8,'negativo','El final fue muy anticlimático y no resolvió bien la trama.',8,8),(9,'positivo','Una historia fantástica con un mundo ricamente detallado. Me encantó.',9,9),(10,'positivo','Un inicio épico para una trilogía increíble. El mundo de la Tierra Media es fascinante.',10,10),(11,'positivo','Una secuela emocionante con una gran expansión del mundo y la trama.',11,11),(12,'positivo','Un final épico para una saga inolvidable. Excelente conclusión.',12,12),(13,'negativo','Demasiado largo y detallado. La historia se perdió en detalles innecesarios.',13,13),(14,'negativo','El ritmo es muy lento y la trama se siente estirada. No logró mantener mi interés.',14,14),(15,'negativo','Demasiados personajes y subtramas. Resulta confuso y difícil de seguir.',15,15),(16,'negativo','El final fue decepcionante y no cerró bien la saga.',16,16),(17,'positivo','Un libro aterrador que me mantuvo despierto por las noches. Excelente.',17,17),(18,'positivo','Una historia de horror psicológico muy bien escrita. Absolutamente recomendada.',18,18),(19,'neutral','Un libro interesante pero un poco largo. La historia es buena, aunque podría ser más concisa.',19,19),(20,'positivo','Un thriller psicológico impresionante con un gran desarrollo de personajes.',20,20),(21,'negativo','Demasiado extenso y con una trama que se siente repetitiva en ocasiones.',21,21),(22,'negativo','El ritmo es irregular y el final no es satisfactorio.',22,22),(23,'negativo','La historia es interesante, pero el desarrollo es muy lento y a veces aburrido.',23,23),(24,'negativo','El desarrollo de los personajes no es tan fuerte como esperaba. Un poco decepcionante.',24,24),(25,'positivo','Una trama intrigante con un giro inesperado al final. Clásico de Christie.',25,25),(26,'positivo','Un misterio bien desarrollado en un entorno exótico. Muy entretenido.',26,26),(27,'positivo','Un misterio de asesinato clásico con una resolución sorprendente.',27,27),(28,'neutral','Un buen misterio, pero la resolución no fue tan impactante como esperaba.',28,28),(29,'negativo','El misterio fue predecible y la resolución no fue satisfactoria.',29,29),(30,'negativo','La trama se siente un poco estirada y el ritmo es lento.',30,30),(31,'negativo','El misterio no es tan intrigante como otros libros de Christie.',31,31),(32,'negativo','La resolución del caso no fue tan impactante como esperaba.',32,32),(33,'positivo','Un inicio épico para una serie impresionante. Intrigas y traiciones en cada página.',33,33),(34,'positivo','Una continuación emocionante que expande la trama de manera impresionante.',34,34),(35,'positivo','Un libro lleno de acción y sorpresas. Una gran adición a la serie.',35,35),(36,'positivo','Una trama fascinante con muchos giros. Aún mejor que el anterior.',36,36),(37,'negativo','Demasiado extenso y con demasiadas subtramas que alargan innecesariamente la historia.',37,37),(38,'negativo','El ritmo es irregular y algunas tramas se sienten sin rumbo.',38,38),(39,'negativo','La narrativa se siente lenta en algunos puntos y el desarrollo de personajes es desigual.',39,39),(40,'negativo','El libro es largo y se siente repetitivo en comparación con los anteriores.',40,40),(41,'positivo','Un misterio clásico de Sherlock Holmes. Intriga y lógica en cada página.',41,41),(42,'positivo','Un gran caso de Holmes con una trama bien construida. Muy entretenido.',42,42),(43,'positivo','Una de las mejores historias de Sherlock Holmes. Intriga y suspense.',43,43),(44,'neutral','Una buena historia, pero no tan fuerte como otros casos de Holmes.',44,44),(45,'negativo','El misterio no es tan intrigante como otros casos de Holmes.',45,45),(46,'negativo','El ritmo es lento y la trama se siente un poco predecible.',46,46),(47,'negativo','La resolución del misterio fue decepcionante y no tan impactante como esperaba.',47,47),(48,'negativo','No me gustó tanto como otras historias de Sherlock Holmes.',48,48),(49,'positivo','Un clásico de la ciencia ficción con una trama muy original y bien desarrollada.',49,49),(50,'positivo','Una continuación que expande la trama de manera efectiva. Muy bien escrito.',50,50);
