INSERT INTO `subCategoria` VALUES (1,'Novela Histórica','Novelas que exploran eventos históricos con elementos ficticios',1),(2,'Realismo Mágico','Ficción que combina elementos realistas con aspectos mágicos',1),(3,'Ficción Literaria','Obras de ficción que se enfocan en el desarrollo de personajes y la escritura estilística',1),(4,'Horror Gótico','Subgénero de terror con elementos góticos',1),(5,'Thriller Psicológico','Suspenso que se enfoca en la psicología de los personajes',1),(6,'Space Opera','Subgénero de ciencia ficción con aventuras épicas en el espacio',1),(7,'Fantasía Épica','Novelas de fantasía que presentan mundos y personajes épicos',1),(8,'Romance Histórico','Novelas románticas situadas en contextos históricos',1),(9,'Aventura Clásica','Relatos de aventuras que siguen el arquetipo de exploración y descubrimiento',1),(10,'Tragedia Clásica','Obras dramáticas con un enfoque en temas trágicos',1),(11,'Fábulas Clásicas','Historias cortas con moralejas dirigidas a niños',4),(12,'Cuentos de Princesas','Historias sobre princesas en escenarios de fantasía',4),(13,'Primeros Libros de Lectura','Libros sencillos para aprender a leer',4),(14,'Fantasía Juvenil','Novelas de fantasía dirigidas a un público juvenil',5),(15,'Misterio Juvenil','Libros de misterio dirigidos a adolescentes',5),(16,'Ciencia Ficción Juvenil','Novelas de ciencia ficción adaptadas para jóvenes',5);
